import (
	context "context"
	fern "github.com/required-nullable/fern"
	fernclient "github.com/required-nullable/fern/client"
)

client := fernclient.NewClient()
response, err := client.GetFoo(
	context.TODO(),
	&fern.GetFooRequest{
		RequiredBaz: "required_baz",
		RequiredNullableBaz: fern.String(
			"required_nullable_baz",
		),
	},
)
